import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import '../../pages/signup/signup.css';

export default function JobhunterDashboard() {
  const { profile, logout } = useAuth();
  const navigate = useNavigate();

  const doLogout = async () => {
    try {
      await logout();
    } catch (e) {
      console.warn('Logout failed', e);
    }
    navigate('/login');
  };

  return (
    <div className="dashboard-root" style={{ display: 'flex', minHeight: '100vh' }}>
      <aside className="dashboard-sidebar" style={{ width: 260, padding: 20, borderRight: '1px solid #eef3f3', background: '#fff' }}>
        <div style={{ marginBottom: 18 }}>
          <h2 style={{ margin: 0, fontSize: 18 }}>WorkConnect</h2>
          <div style={{ marginTop: 6, color: '#6b7280' }}>Jobseeker</div>
        </div>

        <nav>
          <ul style={{ listStyle: 'none', padding: 0, margin: 0, display: 'grid', gap: 6 }}>
            <li><Link to="/jobhunter/dashboard" className="sidebar-link">Dashboard</Link></li>
            <li><Link to="/profile" className="sidebar-link">Profile</Link></li>
            <li><Link to="/jobs" className="sidebar-link">Job Listings</Link></li>
            <li><Link to="/saved-jobs" className="sidebar-link">Saved Jobs</Link></li>
            <li><Link to="/applications" className="sidebar-link">Applications</Link></li>
            <li><Link to="/notifications" className="sidebar-link">Notifications</Link></li>
            <li><Link to="/messages" className="sidebar-link">Messages</Link></li>
            <li><Link to="/settings" className="sidebar-link">Settings</Link></li>
          </ul>
        </nav>

        <div style={{ marginTop: 20 }}>
          <button className="secondary-btn" onClick={doLogout} style={{ width: '100%' }}>Logout</button>
        </div>
      </aside>

      <main className="page-content" style={{ flex: 1, background: '#f8fbfc' }}>
        <div style={{ padding: 24 }}>
          <h1>Jobseeker Dashboard</h1>
          <p>Welcome{profile?.firstName ? `, ${profile.firstName}` : ''} — here are your recommended jobs.</p>
          {/* Placeholder content */}
          <div style={{ marginTop: 18 }}>
            <p><strong>Recommended Jobs</strong></p>
            <ul>
              <li>Frontend Developer — Remote — Acme</li>
              <li>Full-stack Engineer — New York — BetaCorp</li>
            </ul>
          </div>
        </div>
      </main>
    </div>
  );
}
